Every transaction has the execution context. The context is a set of pre-defined variables that are available to the program during execution. For example, every transaction has a sender address, and the transaction context contains a variable that holds the sender address. The transaction context is available to the program through the TxContext struct. The struct is defined in the sui::tx_context module and contains the following fields: File: sui-framework/tx_context.move /// Information about the transaction currently being executed.
/// This cannot be constructed by a transaction--it is a privileged object created by
/// the VM and passed in to the entrypoint of the transaction as `&mut TxContext`.
struct TxContext has drop { /// The address of the user that signed the current transaction sender: address, /// Hash of the current transaction tx_hash: vector<u8>, /// The current epoch number epoch: u64, /// Timestamp that the epoch started at epoch_timestamp_ms: u64, /// Counter recording the number of fresh id's created while executing /// this transaction. Always 0 at the start of a transaction ids_created: u64
} Transaction context cannot be constructed manually or directly modified. It is created by the system and passed to the function as a reference in a transaction. Any function called in a Transaction Block has access to the context and can pass it into the nested calls. TxContext has to be the last argument in the function signature.

