For a more precise time measurement, Sui provides the Clock object. It is a system object that is updated during checkpoints by the system, which stores the current time in milliseconds since the Unix Epoch. The Clock object is defined in the sui::clock module and has a reserved address 0x6. Clock is a shared object and normally would require consensus to access. However, Clock is special, and the system won't allow accessing it mutably, so that the only way to access it is immutably. This limitation allows parallel access to the Clock object and makes it a fast path operation . File: sui-framework/clock.move /// Singleton shared object that exposes time to Move calls. This
/// object is found at address 0x6, and can only be read (accessed
/// via an immutable reference) by entry functions.
///
/// Entry Functions that attempt to accept `Clock` by mutable
/// reference or value will fail to verify, and honest validators
/// will not sign or execute transactions that use `Clock` as an
/// input parameter, unless it is passed by immutable reference.
struct Clock has key { id: UID, /// The clock's timestamp, which is set automatically by a /// system transaction every time consensus commits a /// schedule, or by `sui::clock::increment_for_testing` during /// testing. timestamp_ms: u64,
} There is only one public function available in the Clock module - timestamp_ms. It returns the current time in milliseconds since the Unix Epoch. /// Clock needs to be passed as an immutable reference.
public fun current_time(clock: &Clock) { let _time = clock.timestamp_ms(); // ...
}

